import pandas as pd

def extract_column_data(excel_file, sheet_name, column_name):
    # 엑셀 파일을 읽어오기
    df = pd.read_excel(excel_file, sheet_name=sheet_name)

    # 특정 column 데이터를 list에 담기
    column_data = df[column_name].tolist()

    return column_data

